						   //nfilt为系数数组长度
						   //x输入 y输出 xy长度一致
						   // xlen x的长度 
						   //a b 系数 
						   //zi 初始化参数  长度为  max(length(a),length(b))-1. 
void filter(float* x, double* y, int xlen, double* a, double* b, int nfilt) {
	double tmp;
	int i, j;

	//normalization
	if ((*a - 1.0>EPS) || (*a - 1.0<-EPS)) {
		tmp = *a;
		for (i = 0; i<nfilt; i++) {
			b[i] /= tmp;
			a[i] /= tmp;
		}
	}
	memset(y, 0, xlen * sizeof(double));//将y清零，以双浮点为单位

	a[0] = 0.0;
	for (i = 0; i<xlen; i++) {
		for (j = 0; i >= j&&j<nfilt; j++) {
			y[i] += (b[j] * x[i - j] - a[j] * y[i - j]);
		}
		//if (zi&&i<nfilt - 1) y[i] += zi[i];
	}
	a[0] = 1.0;
}


