// 向量的方差
Type cov(Vector<Type> x)
{
	Type x_mean = sum(x) / x.size();
	Type x_std = sum(pow(x - x_mean, (Type)2)) / (x.size() - 1);
	return x_std;
}
//两向量的协方差
Matrix<Type>cov_Matrix(Vector<Type>x, Vector<Type>y)

{
	Matrix<Type> z(2, 2);
	Type x_mean = sum(x) / x.size();
	Type y_mean = sum(y) / y.size();
	z[0][0] = cov(x);

	z[0][1] = sum((x - x_mean)*(y - y_mean)) / (y.size() - 1);
	z[1][0] = z[0][1];
	z[1][1] = cov(y);
	return z;
}

