Vector<Type> xcorr(Vector<Type>x, Vector<Type>y, unsigned int lengthx, unsigned int lengthy)
{
	unsigned int seq_length = std::max(lengthx, lengthy);
	Vector<Type>cross_corr(2 * seq_length - 1);
	Vector<Type> temp_x(seq_length, 0.f);
	Vector<Type> temp_y(seq_length, 0.f);
	for (int i = 0; i < lengthx; i++)
		temp_x[i] = x[i];
	for (int i = 0; i < lengthy; i++)
		temp_y[i] = y[i];
	Type temp = 0;
	for (unsigned int m = 0; m<(2 * seq_length - 1); m++)
	{
		temp = 0;
		// Corresponding to the index of cross-corr under zero
		if (m<seq_length - 1)
		{
			for (unsigned int n = 0; n <= seq_length - 1 - (seq_length - 1 - m); n++)
				temp += temp_x[n] * temp_y[n + (seq_length - 1 - m)];
		}
		// Calculate the cross-correlation
		else
		{
			for (unsigned int n = 0; n <= seq_length - 1 - (m - (seq_length - 1)); n++)
				temp += temp_x[n + (m - (seq_length - 1))] * temp_y[n];
		}
		cross_corr[m] = temp;
	}

	return cross_corr;
		
}





